// import axios from 'axios'
import {REGISTER} from './types';

const action =(type,payload) =>{
    return{type,payload}
}
export const RegisterAction =(firstName,lastName,email,password,mobileNumber)=>
    action(REGISTER,
    {
    firstName,
    lastName,
    email,
    password,
    mobileNumber
})
